message:
Caras vejam esse caso e como o padrão se segue! Essa mina começou a tomar os inibidores de hormônios com 17 anos, e toma testosterona a 5 anos! Ela já tinha depressão e ansiedade antes de começar com isso, e começou a se consultar com psicólogos e psiquiatras, que aconselharam ela e sua mãe a fazer a “transição de gênero”! Que isso faria passar a confusão mental e a dor que ela sentia por dentro! 

Resultado: Suas doenças mentais só aumentaram, ela vive com vontade de se suicidar, está careca com 21 anos, não se sente bem socialmente quando está com homens ou com mulheres, pensa em “destransicionar” mas já avançou até um ponto que acha q não tem mais retorno! Agora começa a se questionar sobre a quantidade absurda de crianças e adolescentes que estão sendo mutilados antes mesmo de chegar a fase adulta e podem ficar como ela! 
Pois é meu amigo, essa é a CIÊNCIA tão renomada sob a qual nunca pode ser questionada no âmbito acadêmico ou político! 

🤡🤡🤡🤡🤡🤡🤡🤡

